ON THE BLOG: on small parties in the Commons and the pandemic.

@LouiseVThompson and outline how MPs from small parties have been disproportionately affected by the government's choices about how the Commons should operate during the pandemic.
https://t.co/XHlWEjIrCh

To help reduce the spread of COVID-19 when shopping for essentials, keep your distance if you have to queue outside, in the aisles, and while queuing to pay. 
Please be kind to staff and other customers. 
